const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <Navbar />
      {/* <Sidebar /> */}
      <main>
        <h1>Main Content</h1>
        <p>This is where the dynamic main content goes.</p>
      </main>
    </div>
  );
};

export default Dashboard;
